import React from "react";
import log from "../src/images/IMG_20210329_205312_237.jpg";
// import "./Gallery.css";
import { NavLink } from "react-router-dom";

const GnavBar=()=> {
    return (
        <>
        <nav id="nav-bar">
        <div className="navbar h-nav .nav-col">
          <ul className="nav-list ">
            <img src={log} alt="" />
            <NavLink to="./index.html">Home</NavLink>
            <NavLink to="#aboutus">About us</NavLink>
            <NavLink to="">Videos</NavLink>
            <NavLink className="active " to="./gallery.html">
              Gallery
            </NavLink>
            <NavLink to="#services">Services</NavLink>
            <NavLink to="./contact.html">Contact us</NavLink>

            <div className="right-nav">
              <input type="text" placeholder="Search.." />
              <button className="btn-bg">Search</button>
              <button className="btn-bg2">Login</button>
              <button className="btn-bg2">SignUp</button>
            </div>
          </ul>
        </div>
      </nav>
        </>
    );
};
export default GnavBar;
